import React from 'react';
import { Graphics } from 'pixi.js';
import { Sprite, Stage } from '@inlet/react-pixi';

import Pic from '../assets/grunge.jpg'

const Bunny = () => (
  <Stage>
    <Sprite image={Pic} x={Stage.width/2} y={Stage.height/2} />
  </Stage>
);

export default Bunny;
